final List<dynamic> styles = ['@import url(https://fonts.googleapis.com/css?family=Roboto);\r\n@import url(https://fonts.googleapis.com/css?family=Material+Icons);\r\n\r\nbody {\r\n  width: 100vw;\r\n  height: 100vh;\r\n  margin: 0;\r\n  padding: 0;\r\n  display: flex;\r\n  align-items: center;\r\n  justify-content: center;\r\n}\r\n\r\n* {\r\n  font-family: Roboto, Helvetica, Arial, sans-serif;\r\n}\r\n\r\n.loading\r\n{\r\n  position: absolute;\r\n  top: 50%;\r\n  left: 50%;\r\n}\r\n\r\n.cover\r\n{\r\n  position: absolute;\r\n  top: 0px;\r\n  left: 50%;\r\n  width: 76px;\r\n  margin-left: -38px;\r\n  height: 64px;\r\n}\r\n.owl\r\n{\r\n  position: absolute;\r\n  top: 0;\r\n  left: 50%;\r\n  height: 64px;\r\n  margin-left: -24px;\r\n  animation: owl 3s ease-in-out normal infinite;\r\n}\r\n@keyframes owl {\r\n  0% { transform: rotate(0deg); }\r\n  50% { transform: rotate(-360deg); }\r\n  100% { transform: rotate(0deg); }\r\n}\r\n.landscape\r\n{\r\n  position: absolute;\r\n  top: 40px;\r\n  margin-left: -17px;\r\n}\r\n.portrait\r\n{\r\n  position: absolute;\r\n  top: 29px;\r\n  margin-left: -12px;\r\n}\r\n.p1\r\n{\r\n  transform: rotate(180deg);\r\n  _animation: p1 3s linear normal infinite;\r\n}\r\n@keyframes p1\r\n{\r\n  0% { top: 29px; opacity: 1.0; }\r\n  20% { top: 29px; }\r\n  30% { top: 65px; }\r\n  50% { top: 65px;opacity: 1.0; }\r\n  60% { top: 65px;opacity: 0; }\r\n  100% { top: 65px;opacity: 0; }\r\n}\r\n.p2\r\n{\r\n  transform: rotate(180deg);\r\n  _animation: p2 3s linear normal infinite;\r\n}\r\n@keyframes p2\r\n{\r\n  0% { top: 65px; opacity: 1.0; }\r\n  10% { top: 65px; opacity: 0.0; }\r\n  50% { top: 39px; opacity: 0.0; }\r\n  70% { top: 39px; opacity: 1.0; }\r\n  80% { top: 65px; }\r\n  100% { top: 65px; }\r\n}\r\n'];